import React from 'react'
import { Map as LeafletMap , TileLayerr } from "react-leaflet"

function Map() {
  return (
    <div>
     <LeafletMap>
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
        />
      </LeafletMap>
    </div>
  );
}


export default Map
